import React from 'react';
import './navigation.css';

export const Navigation = () => {
    return (
        <div className='container'>
            <nav className='navigation'>
                <div className="logo">
                    {/* logo */}
                    <p>GeekyBay</p>        
                </div>
                <div className='nav-links-container'>
                    <ul className='nav-links'>
                        <li>Home</li>
                        <li>Products</li>
                        <li>Contact</li>
                        <li>Login</li>
                    </ul>
                </div>
            </nav>
        </div>
    )
}
